import { Link } from "react-router-dom";
import "../stylesheets/UX.scss";
import mu from "../images/portada-mu.png";
import asos from "../images/portada-asos.png";

const UX = () => {
  return (
    <div className="ux">
      <Link to="/" className="link">
        <span className="">landing</span>
      </Link>
      <Link to="/Front/" className="link">
        <span className="">front-end developer</span>
      </Link>
      <div>
        <section className="ux__1">
          <img className="ux__1--image" src={asos} />
        </section>
        <section className="ux__2">
          <img className="ux__2--image" src={asos} />
        </section>
        <section className="ux__3">
          <img className="ux__3--image" src={mu} />
        </section>
      </div>
    </div>
  );
};

export default UX;
